import React from 'react'
import './myprojects.css';
import { ProjectCard } from "./ProjectCard";
import futureedu from "../assets/futureedu.png"
import vlab from "../assets/vlab.png"
import ibm from "../assets/ibm.png"
import { Row, Col, Container } from 'react-bootstrap';
import Slider from "react-slick";

function Myprojects() {
  const projects = [
    {
      title: "Future-Edu",
      description: "College Predictor",
      git:"https://github.com/nidhiparab/Future-edu",
      //imgUrl:{require("../assets/me.jpeg")}
      imgUrl:futureedu,
      
    },
    {
      title: "OTT Analysis",
      description: "IBM Dashboard",
      git:"https://github.com/nidhiparab/Future-edu",
      web:"https://github.com/nidhiparab/Future-edu",
      imgUrl:ibm,
    },
    {
      title: "BEE V-Lab",
      description: "Simulation",
      git:"https://github.com/nidhiparab/Future-edu",
      web:"https://github.com/nidhiparab/Future-edu",
      imgUrl:v,
    },
    {
      title: "Hand-2-Hand",
      description: "Student Survival Kit ",
      git:"https://github.com/nidhiparab/Future-edu"
    },
    {
      title: "Quanta",
      description: "UI for Quantum Clustering",
      git:"https://github.com/nidhiparab/Future-edu",
      web:"https://github.com/nidhiparab/Future-edu",
    },
    ];
  return (
    <Container className="body">
<div className="main-scroll-div">
      <div className="cover">
        <a href=""></a>
        <div className="scroll-images">
        {
                          projects.map((project, index) => {
                            return (
                              <ProjectCard
                                key={index}
                                {...project}
                                />
                            )
                          })
                        }
        </div>
      </div>
      
    </div>
    </Container>
    
  )
}

export default Myprojects;
